// idk why this SPDX is needed but remix-ai said it tbh

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

// Implementation of Rock Paper Scissors as Smart Contract
// We need at least 2 Functions one for the commitment and one for the reveal

contract RPS{
    enum Move { Rock, Paper, Scissors, None}    //we need the None for the initial state
    address payable public player1;             //need payable so we can call functions like transfer
    address payable public player2;
    bytes32 public player1Commit;
    bytes32 public player2Commit;
    Move public player1Move;
    Move public player2Move;
    uint public betAmount;
    uint constant REVEAL_TIME = 1 hours;    // time for each of the players allowd to reveal their move
    uint public revealDeadline;

    // i think you need a constructor that sets player 1 as the emplyer of the contract and set state to none so the players are in a state
    constructor(){
        player1 = payable(msg.sender);
        player1Move = Move.None;
        player2Move = Move.None;
    }

    //function to generate commitment off chain
    function generateCommit(uint v, uint rand) public pure returns(bytes32){
        return keccak256(abi.encodePacked(v, rand));
    }

    function setPlayer2(address payable _player2) external payable {
        require(player2 == address(0), "Player 2 is already chosen");
        require(msg.sender != player1, "Player2  cant be player1");
        require(msg.value > 0, "bet amount cant be 0");

        player2 = _player2;
        betAmount = msg.value;
        // i guess debatable but both players should match the same value
        require(msg.value == betAmount, "Bet Amount has too be the same");
    }


    function commitMove(bytes32 commit) external {
        if (msg.sender == player1) {
            require(player1Commit == 0, "Player 1 has commited");
            player1Commit = commit;
        } else {
            require(player2Commit == 0, "Player 2 has comited");
            player2Commit = commit;
        }
    }

    function revealMove(uint move, uint rand) external {
        require(block.timestamp <= revealDeadline, "Reveal time has ben overstepped");
        require(msg.sender == player1 || msg.sender == player2, "not a player");

        // recompute commitment and look if it matches the stored commitment
        bytes32 commit = generateCommit(move, rand);
        if (msg.sender == player1){
            require(commit == player1Commit, "Invalid commit for player1");
            player1Move = Move(move);
        } else {
            require(commit == player2Commit, "Invalid commit for player2");
            player2Move = Move(move);
        }

        // if both players reveal their values you can determine the winner
        if (player1Move != Move.None && player2Move != Move.None){
            determineWinner();
        }
        
    }

    function determineWinner() internal {
        if ((player1Move == Move.Rock && player2Move == Move.Scissors) ||
            (player1Move == Move.Scissors && player2Move == Move.Paper) ||
            (player1Move == Move.Paper && player2Move == Move.Rock)) {
            // Player 1 wins
            player1.transfer(address(this).balance);
        } else {
            player2.transfer(address(this).balance);
            // Player 2 wins
        }
    }


}

